import React from "react";
import "../../../Styles/Pages/ToSell/ToSellFifth.scss";

function ToSellFifth() {
  return (
    <div className='toSellFift'>
      <div className='toSellRight__left'>
        <h1>Improve revenue with localization and smart tools.</h1>
        <p>
          Provide your global customers with the seamless, mobile-friendly,
          localized buying experience they expect. Increase your sales volume
          through promotions and other merchandising tools, such as coupons and
          discounts. Our shopping cart templates and localization tools will
          help boost those conversion rates.
        </p>
      </div>
      <div className='toSellFifth__right'></div>
    </div>
  );
}

export default ToSellFifth;
